import React from 'react';
import { Link } from 'react-router-dom'; // Import Link from react-router-dom

const HomePage = () => {
  return (
    <div style={styles.container}>
      <h1>Welcome to the Movie Rental System</h1>
      <p>Manage your movie rentals efficiently with our system.</p>

      <div id="navigation" style={styles.section}>
        <h2>Navigation</h2>
        <ul style={styles.list}>
          <li><Link to="/memberships" style={styles.link}>Manage Memberships</Link></li>
          <li><Link to="/customers" style={styles.link}>Manage Customers</Link></li>
          <li><Link to="/payments" style={styles.link}>Manage Payments</Link></li>
          <li><Link to="/movies" style={styles.link}>Manage Movies</Link></li>
          <li><Link to="/rentals" style={styles.link}>Manage Rentals</Link></li>
        </ul>
      </div>

      <div id="about" style={styles.section}>
        <h2>About</h2>
        <p>This system allows you to manage memberships, customers, payments, movies, and rentals efficiently. Use the navigation links above to get started with managing the different entities.</p>
      </div>

      <div id="contact" style={styles.section}>
        <h2>Contact Us</h2>
        <p>If you have any questions or need support, please contact us at <a href="mailto:support@movierental.com" style={styles.link}>support@movierental.com</a>.</p>
      </div>
    </div>
  );
};

const styles = {
  container: {
    padding: '20px',
    fontFamily: 'Arial, sans-serif',
  },
  section: {
    marginTop: '20px',
  },
  list: {
    listStyleType: 'none',
    padding: 0,
  },
  link: {
    textDecoration: 'none',
    color: '#007bff',
  },
};

export default HomePage;
